  \"Furbearer track count index testing and development\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:52.328048\",\n\t\"name\": \"furbearer-track-count-index-testing-and-development\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Indices of abundance can be useful in monitoring
  furbearer populations where actual counts of individual animals are difficult. I
  sampled marten and snowshoe hare tracks along a 21-km transect near the Klutina
  Lake trail (KLT) on the west side of the Copper River basin in Southcentral Alaska
  in February and April 1992 and along the first 7 km of that transect in March 1994.
  I also examined marten, lynx, and snowshoe hare track count data, through cooperative
  efforts, in the Wrangell-St. Elias National Park and Preserve (WRST), the Koyukuk/Nowitna
  Refuge Complex (KNRC), and the Tetlin National Wildlife Refuge (TNWR) in Alaska.
  I compared the deposition and retention of tracks, measured in tracks/km, between
  survey periods, among vegetation cover classes, and among the areas sampled. I examined
  harvest data through harvest records, trapper observations, and carcasses purchased
  from trappers. The results are described in this report and recommended procedures
  for counting furbearer tracks along ground transects are provided.\",\n\t\"license_title\":
